   var sixBoxesB = "; x-spacing is controlled by xsep, y-spacing by ysep.\n \n(let [x0 y0 xsep ysep] [10 28 60 60]\n(svg\n  (map (\\[i j]\n    (let xi (+ x0 (mult i xsep)) \n    (let yj (+ y0 (mult j ysep))\n    (square_ xi yj 50))))\n  (cartProd [0 1 2] [0 1]))))\n\n";
